  false,\n\t\"url\": null,\n\t\"notes\": \"In January, 2014 WSI, a Quantum Spatial
  (QSI) company, was contracted by the Puget Sound LiDAR Consortium (PSLC) to collect
  Light Detection and Ranging (LiDAR) data for the Willapa River Valley site in Washington.
  This initial delivery is for the 35,472 acre western area within the greater study
  area. Due to weather and resource constraints, the entire Area of Interest (AOI)
  has not yet been acquired. The remaining acquisition is scheduled to occur during
  the Fall 2014 leaf-off season. Data are being collected to aid PSLC in assessing
  the topographic and geophysical properties of the study area. This report accompanies
  the delivery 1 LiDAR data, and documents contract specifications, data acquisition
  procedures, processing methods, and analysis of the final dataset including LiDAR
  accuracy and density. Acquisition dates and acreage are shown in Table 1, a complete
  list of contracted deliverables provided to PSLC.\",\n\t\"license_title\": null,\n\t\"extras\":
